import React from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';


const match = () => {
    return (
        <div className="container-fluid">
        <div className="row">
          <div className="col-xs-12 col-lg-9">
            <h2>India vs west indies </h2><br/>
            <h4> india 230/5 vs wi 201/5</h4><br/>
            <h3>india won by 29 runs</h3>
            <button className="btn btn primary">match details</button>
          </div>
        </div>
      </div>
    );
}

export default match;
